<html><head>
	<meta charset="utf-8" />
	<meta property="og:image" content="https://tijptjik.github.io/ascension/S07/pointspotential.png">
	<link rel="stylesheet" type="text/css" href="https://cdnjs.cloudflare.com/ajax/libs/semantic-ui/2.2.11/semantic.min.css">
	<link href="https://fonts.googleapis.com/css?family=Open+Sans:400,700|Poppins" rel="stylesheet">

	<script src="https://cdn.plot.ly/plotly-latest.min.js"></script>
	<style>

	body {
		display: flex;
		flex-direction: column;
		justify-content: center;
		overflow: scroll;
		min-height: 1080px;
	}
	.rendered_html * {
    font-family: 'Poppins', sans-serif;
    font-weight: 400 !important;
}
.container { width:100% !important;}
.plotly-graph-div.js-plotly-plot {margin:0 auto;}

.rendered_html h1, 
.rendered_html h2,
.rendered_html h3 {
    font-weight: 700 !important;
    text-align: center;
    width:720px;
    margin-top: 26px;
    margin-bottom: 16px;
} 
.rendered_html h1 {
    font-size: 48px !important;
    text-transform: uppercase;

}

.rendered_html h2 {
    font-size:34px !important;
    color:484747;
    margin-top: 16px;
}

.rendered_html footer h2 {
    margin-top:20px !important;
}

.rendered_html h3 {
    font-size:28px !important;
    margin-top: 16px;
}

.deaths {
    display: flex;
    width:720px;
    flex-flow: row no-wrap;
    justify-content: space-evenly;
    justify-content: center;
}


.labels {
    display: flex;
    width:720px;
    justify-content: center;
}

.ui.obituary.labels {
    flex-flow: column wrap;
}

.ui.obituary.labels .label {
    display: flex;
    font-size: 1.7rem;
    text-transform: uppercase;
    justify-content: space-between;
}

.ui.ranking.labels,
.ui.players.labels  {
    flex-flow: wrap;
}

.ui.ranking.labels .label,
.ui.players.labels .label {
  flex: 0 0 48%;
  margin: 1%;
  overflow: hidden;
  display: flex;
  justify-content: space-between;
  font-size: 1.35rem;
}


.ui.label {
    margin-top: 6px !important;
    margin-bottom: 6px !important;
    color: black !important;
}

.rendered_html h1,
.rendered_html h2 {
	width:100%;
	text-align: center;
	margin-bottom: 0px !important;
	}



	</style>
</head>
